import './App.css';
export function App () {




    return (
        <article>
            <header>
                <img alt="El avatar de midudev"src="https://unavatar.io/midudev" />
                <div>
                    <strong>Miguel Ángel Durán</strong>
                    <span>@midudev</span>
                </div>
            </header>
            <aside>
                <button>
                    Seguir
                </button>
            </aside>
        </article>
    );
}
